let ClientOAuth2 = require("client-oauth2");

let {
  oauth_client_id,
  oauth_client_secret,
  oauth_token_url,
  oauth_grant_type,
  oauth_Authorization_key,
  oauth_redirect_url
} = process.env;

export let OauthConfig = new ClientOAuth2({
  clientId: oauth_client_id,
  clientSecret: oauth_client_secret,
  accessTokenUri: oauth_token_url,
  redirectUri: oauth_redirect_url,
  scopes: ["email", "name"],
});
